  "description": "Rancher Compose 工具的工作方式是跟 Docker Compose 的工作方式是相似的，并且支持版本 V1 的 `docker-compose.yml` 文件。为了启用 Rancher 的特性，您需要额外一份`rancher-compose.yml`文件，这份文件扩展并覆盖了`docker-compose.yml`文件。例如，服务缩放和健康检查这些特性就会在`rancher-compose.yml`中体现。",
  "source": "@site/docs/rancher1/infrastructure/cattle/rancher-compose/commands/_index.md",
  "permalink": "/docs/rancher1/infrastructure/cattle/rancher-compose/commands/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/rancher1/infrastructure/cattle/rancher-compose/commands/_index.md",
