const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Rancher Compose 工具的工作方式是跟 Docker Compose 的工作方式是相似的，并且支持版本 V1 的 `}<inlineCode parentName="p">{`docker-compose.yml`}</inlineCode>{` 文件。为了启用 Rancher 的特性，您需要额外一份`}<inlineCode parentName="p">{`rancher-compose.yml`}</inlineCode>{`文件，这份文件扩展并覆盖了`}<inlineCode parentName="p">{`docker-compose.yml`}</inlineCode>{`文件。例如，服务缩放和健康检查这些特性就会在`}<inlineCode parentName="p">{`rancher-compose.yml`}</inlineCode>{`中体现。`}</p>
    <h3 {...{
      "id": "rancher-compose-命令"
    }}>{`Rancher-Compose 命令`}</h3>
    <p>{`Rancher Compose 支持所有 Docker Compose 支持的命令。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`create`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`创建所有服务但不启动`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`up`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`启动所有服务`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`start`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`启动服务`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`logs`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`输出服务日志`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`restart`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`重启服务`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`stop`}</inlineCode>{`, `}<inlineCode parentName="td">{`down`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`  停止服务`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`scale`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`缩放服务`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`rm`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`删除服务`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`pull`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`拉取所有服务的镜像`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`upgrade`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`服务之间进行滚动升级`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`help`}</inlineCode>{`, `}<inlineCode parentName="td">{`h`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`输出   命令列表或者指定命令的帮助列表`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "rancher-compose-选项"
    }}>{`Rancher Compose 选项`}</h3>
    <p>{`无论何时您使用 Rancher Compose 命令，这些不同的选项您都可以使用`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--verbose`}</inlineCode>{`, `}<inlineCode parentName="td">{`--debug`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--file`}</inlineCode>{`, `}<inlineCode parentName="td">{`-f`}</inlineCode>{` `}{`[--file option --file option]`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`指定一个 compose 文件 (默认: `}<inlineCode parentName="td">{`docker-compose.yml`}</inlineCode>{`) `}{`[$COMPOSE_FILE]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--project-name`}</inlineCode>{`, `}<inlineCode parentName="td">{`-p`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`指定一个项目名称 (默认: directory name)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--url`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`执行 Rancher API 接口 URL `}{`[$RANCHER_URL]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--access-key`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`指定 Rancher API access key `}{`[$RANCHER_ACCESS_KEY]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--secret-key`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`指定 Rancher API secret key `}{`[$RANCHER_SECRET_KEY]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--rancher-file`}</inlineCode>{`, `}<inlineCode parentName="td">{`-r`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`指定一个 Rancher Compose 文件 (默认: `}<inlineCode parentName="td">{`rancher-compose.yml`}</inlineCode>{`)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--env-file`}</inlineCode>{`, `}<inlineCode parentName="td">{`-e`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`指定一个   环境变量   配置文件`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--help`}</inlineCode>{`, `}<inlineCode parentName="td">{`-h`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`  输出帮助文本`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--version`}</inlineCode>{`, `}<inlineCode parentName="td">{`-v`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`  输出 Rancher Compose 版本`}</td>
        </tr>
      </tbody>
    </table>
    <h4 {...{
      "id": "例子"
    }}>{`例子`}</h4>
    <p>{`准备开始后，您需要   创建一个 `}<inlineCode parentName="p">{`docker-compose.yml`}</inlineCode>{` 文件和一个可选的 `}<inlineCode parentName="p">{`rancher-compose.yml`}</inlineCode>{` 文件，如果没有 `}<inlineCode parentName="p">{`rancher-compose.yml`}</inlineCode>{` 文件，那么   所有服务默认只分配 1 个   容器`}</p>
    <h5 {...{
      "id": "\b-样例文件-docker-composeyml"
    }}>{`  样例文件 `}<inlineCode parentName="h5">{`docker-compose.yml`}</inlineCode></h5>
    <pre><code parentName="pre" {...{}}>{`version: '2'
services:
  web:
    image: nginx
  db:
    image: mysql
    environment:
      MYSQL_ROOT_PASSWORD: test
`}</code></pre>
    <h5 {...{
      "id": "\b-样例文件-rancher-composeyml"
    }}>{`  样例文件 `}<inlineCode parentName="h5">{`rancher-compose.yml`}</inlineCode></h5>
    <pre><code parentName="pre" {...{}}>{`# Reference the service that you want to extend
version: '2'
services:
  web:
    scale: 2
  db:
    scale: 1
`}</code></pre>
    <p>{`当您   的这些文件创建好后，您就可以启动这些服务到 Rancher 服务了`}</p>
    <pre><code parentName="pre" {...{}}>{`# Creating and starting services without environment variables and selecting a stack
# If the stack does not exist in Rancher, it will be created in Rancher
$ rancher-compose --url URL_of_Rancher --access-key <username_of_environment_api_key> --secret-key <password_of_environment_api_key> -p stack1 up

# Creating and starting services with environment variables already set
$ rancher-compose -p stack1 up

# To change the scale of an existing service
$ rancher-compose -p stack1 scale web=3

# To launch a specific service in the docker-compose.yml
$ rancher-compose -p stack1 up web
`}</code></pre>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意:`}</strong>{` 如果您   没有传入 `}<inlineCode parentName="p">{`-p <STACK_NAME>`}</inlineCode>{`，应用名就是您执行 Rancher Compose 命令所在的文件夹名称。`}</p>
    </blockquote>
    <h4 {...{
      "id": "使用---env-file-选项"
    }}>{`使用 `}<inlineCode parentName="h4">{`--env-file`}</inlineCode>{` 选项`}</h4>
    <p>{`当您运行 Rancher Compose 命令时，可以使用`}<inlineCode parentName="p">{`--env-file`}</inlineCode>{` 选项传入一个环境变量配置文件。`}</p>
    <h5 {...{
      "id": "样例-secrets-文件"
    }}>{`样例 `}<inlineCode parentName="h5">{`secrets`}</inlineCode>{` 文件`}</h5>
    <pre><code parentName="pre" {...{}}>{`MYSQL_ROOT_PASSWORD=test
`}</code></pre>
    <h5 {...{
      "id": "样例文件-docker-composeyml"
    }}>{`样例文件 `}<inlineCode parentName="h5">{`docker-compose.yml`}</inlineCode></h5>
    <pre><code parentName="pre" {...{}}>{`version: '2'
services:
  db:
    image: mysql
    environment:
    # Just like Docker Compose, if there is only a key, Rancher Compose will resolve to
    # the values on the machine or the file passed in using --env-file
      MYSQL_ROOT_PASSWORD:
`}</code></pre>
    <p>{`您可以启动   服务时传入 `}<inlineCode parentName="p">{`secrets`}</inlineCode>{` 文件`}</p>
    <pre><code parentName="pre" {...{}}>{`$ rancher-compose --env-file secrets up -d
`}</code></pre>
    <p>{`在传入一个文件并一个环境变量   只含一个 key，Rancher Compose    将从这个文件或者从   运行 Rancher Compose 命令的机器中的系统环境变量中提取这个值。当在文件和   系统   环境变量中同时存在同一个变量时，Rancher Compose 使用   文件中的值。`}</p>
    <h3 {...{
      "id": "命令-\b-选项"
    }}>{`命令   选项`}</h3>
    <h4 {...{
      "id": "up-命令"
    }}>{`up 命令`}</h4>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--pull`}</inlineCode>{`, `}<inlineCode parentName="td">{`-p`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`升级前先在各个已有这个镜像的主机拉取最新镜像`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`-d`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`不要阻塞或   输出日志`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--upgrade`}</inlineCode>{`, `}<inlineCode parentName="td">{`-u`}</inlineCode>{`, `}<inlineCode parentName="td">{`--recreate`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`  当服务改变时升级`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--force-upgrade`}</inlineCode>{`, `}<inlineCode parentName="td">{`--force-recreate`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`强制升级服务，不管服务是否    改变`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--confirm-upgrade`}</inlineCode>{`, `}<inlineCode parentName="td">{`-c`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`确认升级成功并删除老容器`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--rollback`}</inlineCode>{`, `}<inlineCode parentName="td">{`-r`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`回滚到上一个已部署的版本`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--batch-size "2"`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`每次升级多少个容器`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--interval "1000"`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`升级间隔`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`当您运行 Rancher Compose 的 `}<inlineCode parentName="p">{`up`}</inlineCode>{` 命令时，在   所有任务    完成后进程会继续运行。如果您希望    任务完成后进程退出，那么您需要传入 `}<inlineCode parentName="p">{`-d`}</inlineCode>{` 选项，  防止阻塞和输出日志。`}</p>
    <pre><code parentName="pre" {...{}}>{`# If you do not use the -d flag, Rancher Compose will continue to run until you Ctrl+C to quit
$ rancher-compose up

# Use the -d flag for rancher-compose to exit after running
$ rancher-compose up -d
`}</code></pre>
    <p>{`阅读更多关于 `}<a parentName="p" {...{
        "href": "/docs/rancher1/infrastructure/cattle/upgrading/_index#%E9%80%9A%E8%BF%87rancher-compose%E5%91%BD%E4%BB%A4%E8%A1%8C%E8%BF%9B%E8%A1%8C%E6%9C%8D%E5%8A%A1%E5%8D%87%E7%BA%A7"
      }}>{`利用 Rancher Compose 升级服务`}</a>{`.`}</p>
    <h4 {...{
      "id": "start-命令"
    }}>{`start 命令`}</h4>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`-d`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`防止阻塞或   输出   日志`}</td>
        </tr>
      </tbody>
    </table>
    <p>{` 
如果您希望    任务完成后进程退出，那么您需要传入 `}<inlineCode parentName="p">{`-d`}</inlineCode>{` 选项，  防止阻塞和输出日志。`}</p>
    <h4 {...{
      "id": "logs-命令"
    }}>{`logs 命令`}</h4>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--follow`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`  持续   输出日志`}</td>
        </tr>
      </tbody>
    </table>
    <h4 {...{
      "id": "restart-命令"
    }}>{`restart 命令`}</h4>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--batch-size`}</inlineCode>{` `}<inlineCode parentName="td">{`"1"`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`每次重启多少个容器`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--interval`}</inlineCode>{` `}<inlineCode parentName="td">{`"0"`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`重启间隔`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`缺省情况下， Rancher Compose 会顺序地    逐个   重启服务。您可以设置批量大小   和重启间隔。`}</p>
    <h4 {...{
      "id": "stop-与-scale"
    }}>{`stop 与 scale`}</h4>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--timeout`}</inlineCode>{`, `}<inlineCode parentName="td">{`-t`}</inlineCode>{` `}<inlineCode parentName="td">{`"10"`}</inlineCode></td>
